import base64, io, PySimpleGUI as psg, qrcode.constants as constants
from PIL import Image
from qrcode.main import QRCode

def create_layout():
    psg.theme("DarkBlack")
    layout = [
            [psg.Column([
                [psg.Text("QR Code Content"), psg.Input("", change_submits=True, expand_x=True, key="-QR-CONTENT-")],
                [psg.Text("Export Filename"), psg.Input("", change_submits=True, expand_x=True, pad=((11, 0), 0), key="-EXP-TITLE-"),
                 psg.Button("Export", disabled=True, key="-EXP-BTN-")]
                ]), 
            psg.Column([
                [psg.Image(convert(create_code()), size=(285, 285), subsample=2, key="-IMG-PREVIEW-")]
                ])]
            ]
    return layout

def fis_logo():
    return b''

def create_code(content:str = ""):

    QRcode = QRCode(version=8 ,error_correction=constants.ERROR_CORRECT_H) 
    QRcode.add_data(content)
    QRcode.make()
    QRimg = QRcode.make_image(fill_color="black", back_color="white").convert("RGB")
    
    logo = Image.open(io.BytesIO(base64.b64decode(fis_logo())))
    basewidth = 150
    wpercent = (basewidth/float(logo.size[0]))
    hsize = int((float(logo.size[1])*float(wpercent)))
    logo = logo.resize((basewidth, hsize), Image.Resampling.NEAREST)
    pos = ((QRimg.size[0] - logo.size[0]) // 2, (QRimg.size[1] - logo.size[1]) // 2)
    QRimg.paste(logo, pos)

    return QRimg

def convert(img):
    with io.BytesIO() as bio:
        img.save(bio, format="PNG")
        del img
        return bio.getvalue()

def main():
    window = psg.Window("FIS QR Generator | by Piombacciaio", create_layout(), finalize=True, icon=fis_logo())

    while True:
        events, values = window.read()
        if events == psg.WIN_CLOSED: break
        if events == "-QR-CONTENT-":
            qr_img = create_code(values["-QR-CONTENT-"])
            window["-IMG-PREVIEW-"].update(convert(qr_img), subsample=2)
        if events == "-EXP-TITLE-":
            window["-EXP-BTN-"].update(disabled=False)
        if events == "-EXP-BTN-":
            try:
                qr_img.save(values["-EXP-TITLE-"] + ".png")
            except UnboundLocalError:
                qr_img = create_code(values["-QR-CONTENT-"])
                qr_img.save(values["-EXP-TITLE-"] + ".png")

if __name__ == "__main__": main()
